import './comp.css';

function Comp07(props) {
    const elem1 = <p>elem1</p>;
    const elem2 = <div><span>one</span><span>+</span><span>two</span></div>;
    const elem3 = <><span>one</span><span>+</span><span>two</span></>;
    return (
        <div className="comp comp06">
            <h3><span>07</span></h3>
            <li>{elem1}</li>
            <li>{elem2}</li>
            <li>{elem3}</li>
        </div>
    )
}

export default Comp07;
